//*****GROOVY SCRIPT******//

class Lucky{

def log;
def context;
def testRunner;

def Lucky(log, context, testRunner)
{
	this.log = log;
	this.context = context;
	this.testRunner = testRunner;

	}

	def sayHello(String name)
	{
		log.info ("Hai Good Aftnoon " +name);
	}

}

context.setProperty("Lucky", new Lucky(log, context, testRunner));

def project = testRunner.testCase.testSuite.project ;
def tcase = project.testSuites["PropertyTestDemo"].testCases["TestCase1"] ; 
def tstep = tcase.getTestStepByName("Lucky");

tstep.run(testRunner, context);
context.Lucky.sayHello("SaiKumar");

